import React, { Component } from "react";
import { HorizontalBar } from "react-chartjs-2";

import Data from "../Data/tableData";
import "../Page/Work.css";

class BarExample extends Component {
  render() {
    const Data1 = Data;

    const data = {
      labels: [
        Data1[0].name,
        Data1[1].name,
        Data1[2].name,
        Data1[3].name,
        Data1[4].name,
        Data1[5].name,
        Data1[6].name,
        Data1[7].name,
        Data1[8].name,
        Data1[9].name,
        Data1[10].name,
        Data1[11].name,
        Data1[12].name,
        Data1[13].name,
        Data1[14].name,
        Data1[15].name,
        Data1[16].name,
        Data1[17].name,
      ],
      datasets: [
        {
          label: "My First dataset",
          backgroundColor: "rgba(255,99,132,0.2)",
          borderColor: "rgba(255,99,132,1)",
          borderWidth: 1,
          hoverBackgroundColor: "rgba(255,99,132,0.4)",
          hoverBorderColor: "rgba(255,99,132,1)",
          data: [65, 59, 80, 81, 56, 55, 40],
        },
        {
          label: "hell",
          backgroundColor: "rgba(200,99,132,0.2)",
          borderColor: "rgba(200,99,132,0.2)",
          borderWidth: 1,
          hoverBackgroundColor: "rgba(200,99,132,0.2)",
          hoverBorderColor: "rgba(200,99,132,0.2)",
          data: [25, 20, 90, 81, 96, 55, 20],
        },
      ],
    };

    return (
      <div className="flex flex-col items-center w-full max-w-md">
        <HorizontalBar data={data} />
      </div>
    );
  }
}

export default BarExample;
